@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("inimigo.publico.pt") {
    .fl {float: none !important;}
    body,.georgia {font-family: "Serif" !important;}

    #mainmenu,
    #submenu,
    #header >ul,
    .faixazul,.faixazul-top,.faixazul-bottom,
    .coluna,
    #errobox,
    #footer,
        .subcolesq,
        div.artigo b,div.artigo a,
        div.icons
    {
        display: none !important;
    }
    
    #header {
        width: 754px !important; /* 680 + 74 */
        height: 123px !important; /* 108 + 15 */
        float: none !important;
        margin-top: 10px;
        margin-bottom: 35px;
    }
    #header > h1 img { /* Image Replacement */
        padding-left: 680px;
        padding-top: 108px;
        overflow: hidden;
        height: 0px;
        width: 0px;
        background: url("data:image/png;base64,") no-repeat top left;
    }
    #header > h1,#header > h2 {
        float: left !important;
        margin: 0 auto;
    }
    #header > h3 {
        float: right !important;
        margin: 0 auto;
    }
    
    div.artigo h1 {
        text-align: center;
        color: #DBA716;
    }
    div.artigo h3 {
        text-align: left;
        color: #508ED8;
    }
    div.coluna-dupla,
    #container {
        text-align: center;
        width: 100% !important;
        margin: 0 auto;
    }
    div.artigo {
        width: 700px;
        margin: 0 auto;
        margin-bottom: 25px;
    }
    div.artigo > * {
        text-align: justify;
    }
    
    body {
        background: black;
        color: #00A000;
    }
}
